// src/components/Header/Header.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import s from './Header.module.scss';

const Header = () => {
  return (
    <header className={s.header}>
        <div className={s.header__container}>
            <nav className={s.header__nav}>
                <nav className={s.header__nav-left}>
                    <Link to="/menu" className={s.header__nav-link}>le menu</Link>
                    <Link to="#" className={s.header__nav-link}>contact</Link>
                </nav>
                <Link to="/home">
                    <div className={s.header__logo}></div>
                </Link>
                <nav className={s.header__nav-right}>
                    <Link to="#" className={s.header__nav-link}>mon panier</Link>
                    <Link to="#" className={s.header__nav-link}>lang</Link>
                </nav>
            </nav>
        </div>
    </header>
  );
};

export default Header;
